import Vue from 'vue';
import Router from 'vue-router';

import HomeAula from '../components/Home.vue';
import AboutAula from '../components/AboutAula.vue';


Vue.use(Router);

const routes = [
  { path: '/', name: 'Home', component: HomeAula },
  { path: 'about', name: 'About', component: AboutAula },

];

const router = new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
});

export default router;
